import React from "react";
import { Routes } from "react-router-dom";
import { useRoutes } from "./pages/Routes";


const MainPage = () => {
    const routes = useRoutes(true);
    return (
        <Routes>
            {routes}
        </Routes>
    )
}

export default MainPage;
